library decisiontree;
class Node {
  String label;
  double gini;
  int sample;
  List<double> value;
  
  Node(this.label, this.gini, this.sample, this.value);
}

class DecisionNode extends Node {
  int id;
  double condition;
  Node left;
  Node right;
  DecisionNode(
      String label, this.id, this.condition, double gini, int sample, List<double> value, this.left, this.right)
      : super(label, gini, sample, value);
}

class TerminalNode extends Node {
  TerminalNode(String label, double gini, int sample, List<double> value) : super(label, gini, sample, value);

  List<int> get_id() {
    List<int> id = [];
    for (var i = 0; i < value.length; i++) {
      if (value[i] != 0) {
        id.add(i);
      }
    }
    return id;
  }
}


